import React from "react";
import {
  createBrowserRouter,
  RouterProvider,
  Routes,
  Route,
  Link,
  BrowserRouter,
} from "react-router-dom";
import Records from "./pages/Records";
import ".style"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Records/>}/>
        </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
